function createJSON(char) {
	char == "Missy" ?	 	setData( 0.04, 3, 4, 3, 4) :
	char == "Zoe" ?	 		setData( 0.08, 4, 4, 3, 3) :
	char == "Heather" ?	 	setData( 0.12, 3, 3, 3, 5) :
	char == "Jenny" ?	 	setData( 0.16, 4, 3, 5, 3) :
	char == "Vivian" ?	 	setData( 0.2, 4, 3, 3, 4) :
	char == "Madam" ?	 	setData( 0.24, 3, 4, 3, 4) :
	char == "Darrin" ?	 	setData( 0.28, 5, 3, 3, 3) :
	char == "Ox" ?	 		setData( 0.32, 5, 3, 3, 3) :
	char == "Peter" ?	 	setData( 0.36, 4, 3, 4, 3) :
	char == "Brandon" ?	 	setData( 0.4, 4, 4, 4, 3) :
	char == "Father" ?	 	setData( 0.44, 3, 3, 5, 4) :
							setData( 0.48, 4, 3, 3, 4);
}

function setData(timeRemap, speed, might, sanity, knowledge) {
	animData.layers[0].ef[1].ef[0].v.k = 0;		// Modifier for 'which stat is user pressing down on'. Needs to be reset.

	animData.assets[1].layers[4].tm.k = timeRemap;		// Sets name & colour for character
	animData.layers[1].tm.k = timeRemap;		// Sets stones for character
	animData.assets[1].layers[2].tm.k = timeRemap;

	animData.layers[0].ef[2].ef[0].v.k = speed;
	animData.layers[0].ef[3].ef[0].v.k = might;
	animData.layers[0].ef[4].ef[0].v.k = sanity;
	animData.layers[0].ef[5].ef[0].v.k = knowledge;

	tempStoneInfo.speed = permStoneInfo.speed = speed;
	tempStoneInfo.might = permStoneInfo.might = might;
	tempStoneInfo.sanity = permStoneInfo.sanity = sanity;
	tempStoneInfo.knowledge = permStoneInfo.knowledge = knowledge;


}
